★ホーズのカジュアルスニーカー！<br>
<br>
●アッパーは丈夫なキャンバス生地を使用し、ラフでカジュアルなコーディネイトに合わせやすいアイテム。<br>
●適度なクッション性のインソールで履き心地も快適！<br>
●かかととつま先のストライプゴムがポイント！<br>
●アウトソールはブランドロゴを敷き詰めたユニークなデザイン！設置面を広くとったフラットシューズは歩きやすく、レジャーや旅行にもオススメ！<br>
●飽きの来ない定番デザインは何足あっても困らず、一年を通してお使いいただけます！<br>
<br>
■素材<br>
アッパー、インナー：コットン<br>
アウトソール：ラバー<br>
<br>
※画像のカラーは、撮影時の照明等の具合により実物と異なる可能性がございます。<br>
なお、商品の色の見え方と実物の色は、お客様のご使用されているパソコン・モニターの環境等により多少異なる場合がございますのでご了承ください。<br>
<BR>
<BR>
■サイズ 22.5～24.5cm<br>
<br>
《当店スタッフの着用感コメント》<br>
こちらのシューズのワイズ幅は標準となっております。<br>
・きっちり、ジャストフィット感をお求めの場合はジャストサイズをおススメ致します。<br>
・少し余裕のあるサイズ感をお求めの場合は0.5cmアップ。<br>
・幅広甲高の方、ゆったりとした履き心地をお求めの場合は1.0cmアップ<br>
をお選び頂ければ良いかと思われます。<br>
※サイズ選びは足型や履き心地等に個人差がございますのであくまで目安としてお考えください。
