★アーノルドパーマーのハイカットスニーカー！！<br>
<br>
●細身のシルエットが特徴的なハイカットタイプのスニーカー！内側にファスナーを施す仕様を採用しているので、容易な着脱も実現！！<br>
●ベロにはシューレースホルダーを付け、履きやすさが更にアップ！！<br>
●インソールには疲れにくく足に優しい、クッション性の良いラテックススポンジを配置。<br>
●屈曲性に優れ、足の動きにしなやかにフィットする、バルカナイズ製法を採用し、軽やかな履き心地を実現！！<br>

<br>
■素材<br>
アッパー：コットン<br>
ミッドソール：ラテックススポンジ<br>
アウトソール：ラバー<br>
<br>
■企画製造販売元：株式会社ダイマツ<br>
